CREATE TABLE IF NOT EXISTS events (
    `id` VARCHAR(36) PRIMARY KEY,
    `title` VARCHAR(92),
    `description` VARCHAR(468),
    `author` VARCHAR(36),
    `spot` JSON,
    `date` DATETIME,
    `created_at` DATETIME,
    `updated_at` DATETIME
) ENGINE=INNODB;








CREATE TABLE IF NOT EXISTS members (
    `id` VARCHAR(36) PRIMARY KEY,
    `username` VARCHAR(17) ,
    `is_guest` BOOLEAN,
    `event_id` VARCHAR(36),
    `created_at` DATETIME,
    `updated_at` DATETIME
) ENGINE=INNODB;

ALTER TABLE `members`
    ADD CONSTRAINT `fk_member_event` FOREIGN KEY (`event_id`) REFERENCES `events`(`id`) ON DELETE CASCADE ON UPDATE CASCADE; 




CREATE TABLE IF NOT EXISTS messages (
    `id` VARCHAR(36),
    `content` VARCHAR(389),
    `author` VARCHAR(36),
    `event_id` VARCHAR(36),
    `media` JSON,
    `created_at` DATETIME,
    `updated_at` DATETIME
) ENGINE=INNODB;

ALTER TABLE `messages`
ADD CONSTRAINT `fk_message_event` FOREIGN KEY (`event_id`) REFERENCES `events`(`id`) ON DELETE CASCADE ON UPDATE CASCADE;
    
ALTER TABLE `messages` 
ADD CONSTRAINT `fk_message_member` FOREIGN KEY (`author`) REFERENCES `members`(`id`) ON DELETE CASCADE ON UPDATE CASCADE;



